drop database if exists infectstatistic;
create database infectStatistic;

use infectStatistic;

create table province(
p_name varchar(127),
p_date date,
primary key (p_name, p_date),
ip int default 0,
n_ip int default 0,
c_ip int default 0,
cure int default 0,
n_cure int default 0,
dead int default 0,
n_dead int default 0
);

create table nation(
n_date date primary key,
ip int default 0,
n_ip int default 0,
c_ip int default 0,
cure int default 0,
n_cure int default 0,
dead int default 0,
n_dead int default 0,
sp int default 0,
n_sp int default 0
);

